import { Vector3 } from "three";
import * as THREE from "three";
import { Sphere } from "./Sphere";

export class World {
    private objects = null;

    constructor() {
        this.objects = [];
    }

    test(): void {
        const s = new Sphere();
        this.objects.push("hi");
        console.log("hi");
        console.log(this.objects);
    }
}
